import item3 from '../Images/Homepack/Corsoler3.jpeg';
import { useEffect, useState } from "react";

function Home(){

    const [LatestNews, setLatestNews] = useState([]);

    useEffect(()=> {
     async function GetLatestnews(){
        const requestedUrl = "https://newsapi.org/v2/everything?q=Apple&from=2024-05-13&sortBy=popularity&apiKey=e780c437a3f6462d9234ff6cb17aeb34"
     }
    });

    return(
        <>
          <Container className="mt-10 md" style={{height:"30%", width:"100%"}}>
                <Row>
                    <Col xs={12} md={12}>
                        <Carousel>
                            <Carousel.Item interval={1000}>
                            <img src={item3} className="fluid" alt="3" fluid/>
